import Action from "../Actions";

const DEFAULT_URL = 'http://192.168.100.8:8080/api/v1/profile?page='

let initialState = {
	'users': [],
	'page_count': 0,
	'page_size': 0,
	'current_page': 1,
	'next_url': DEFAULT_URL + "2",
	'previous_url': DEFAULT_URL + "1",
}

const usersReducer = (state = initialState, action) => {
	switch (action.type) {
		case Action.SET_USERS: {
			let stateCopy = structuredClone(state)
			stateCopy.users = action.users
			stateCopy.page_size = action.page_size
			stateCopy.page_count = action.page_count
			stateCopy.current_page = action.current_page || 1
			console.log(stateCopy.current_page)

			if (action.next_url)
				stateCopy.next_url = action.next_url
				console.log(stateCopy.current_page + 1)
				stateCopy.current_page += 1
				console.log(stateCopy.current_page)
			if (action.previous_url)
				stateCopy.previous_url = action.previous_url
				if (stateCopy.current_page > 1) stateCopy.current_page--

			console.log(stateCopy.current_page)
			return stateCopy
		}
		default: return state
	}
}

export default usersReducer;
